import React from "react";

// import material-ui components
import { makeStyles } from "@material-ui/core/styles";
import { Box } from "@material-ui/core";

const useStyles = makeStyles({
  aboutContainer: {
    height: "50vh",
    width: "80vw"
  }
});

function About() {
  const classes = useStyles();
  return (
    <>
      <Box className={classes.aboutContainer}>
        <Box
          justifyContent="center"
          alignItems="center"
          display="flex"
          className={classes.aboutContainer}
          id="about"
        >
          Hi, I'm Jay. I am a full stack developer in sunny Orange County, CA. I
          enjoy seeing dreams slowly come to life and would love to work with
          you on your next project if our visions align! I come from a
          background of cognitive psychology and I am known for delivering
          user-focused designs through researching, iterating, and testing.
          Looking forward to help your ideas reach their maximum potential.
        </Box>
      </Box>
    </>
  );
}

export default About;
